package com.neo.thirteen;/** * Created by cainiao on 2020-08-22 13:28 */public class RecursiveFibonacci2 {    private IntCall intCall;    public RecursiveFibonacci2(IntCall intCall) {        this.intCall = intCall;    }    public static void main(String[] args) {        IntCallImpl intCall = new IntCallImpl();        for (int i=0;i<11;i++){            System.out.println(intCall.call(i));        }    }}